  // track added files only
  const diff = await $`git status --short`
  const rows = `${diff}`.trim().split('\n')
  let files = []
  for (let row of rows) {
    let columns = row.split(' ').filter((item) => item !== '')
    if (['A', 'M', 'AM'].indexOf(columns[0]) >= 0) {
      files.push(columns[1])
    }
  }

